import React from 'react';
import { Stack } from '@mui/system';

const Sidebar = () => {
    return (
        <Stack
  direction="column"
  justifyContent="space-around"
  alignItems="center"
  spacing={2}
  sx={{mt:'20px'}}
>
   <div>GSTIN list</div> 
   <div>Return Status</div>
</Stack>
    );
}

export default Sidebar;
